import React from 'react';
import ButtonLarge from './ButtonLarge';
import ButtonMideum from './ButtonMideum';
import ButtonSmall from './ButtonSmall';
import Button from './Button';

function Buttons(props) {
    return (
        <>
            <h1>Button</h1>
            <ButtonLarge size="lBtn" type="primary" icon="arrow" >프라지아이콘유</ButtonLarge>
            <ButtonMideum/>
            <ButtonSmall/>
            <Button size="l" type="primary"></Button>
        </>
    );
}

export default Buttons;
